app.controller("searchController",["$scope","$http","categoriesFactory","searchFactory",(e,n,t,o)=>{$(()=>{$(".rating").rating({maxRating:5,interactive:!1})}),e.init=(n=>{t.getCategories().then(t=>{e.categories=t,e.categoryIndex=e.categories.findIndex(e=>e._id==n),console.log(e.categoryIndex)})}),e.$watch("place",()=>{e.place.address_components&&(e.placeLongName=e.place.address_components[0].long_name)}),e.loadingEvents=!1,e.showEvents=(n=>{e.loadingEvents=!0,o.getEventsByLocationName(n).then(n=>{e.events=n,e.loadingEvents=!0,console.log(e.events)})})}]);